import React from "react";
import { Container, Row, Col } from "react-bootstrap";
export default (props) => {
  console.log("In Component");
  console.log(props);
  return (
    <Container fluid="md">
      <Row>
        <Col>1 of 3</Col>
        <Col xs={6}>2 of 3 (wider)</Col>
        <Col>3 of 3</Col>
      </Row>
    </Container>
  );
};
